var canvas, stage, exportRoot;
function init() {
	// --- write your JS code here ---
	var sess_key = localStorage.hd_session_key;
	var getprov = "http://api.haagendazsindonesia.co.id/v1/province?session_key="+ sess_key +"";

	$.getJSON(getprov,function(check){
		//console.log(provinsi.payload[2].province_name);
		
		if(check.is_error==true){
			localStorage.login_hd = "";
		}

	  
	});
	canvas = document.getElementById("canvas");
	images = images||{};
	ss = ss||{};

	var loader = new createjs.LoadQueue(false);
	loader.addEventListener("fileload", handleFileLoad);
	loader.addEventListener("complete", handleComplete);
	loader.loadFile({src:"img/idea2_atlas_.json", type:"spritesheet", id:"idea2_atlas_"}, true);
	loader.loadManifest(lib.properties.manifest);
}

function handleFileLoad(evt) {
	$(".screen").fadeOut("fast");
	$("canvas").fadeIn("slow");
	if (evt.item.type == "image") { images[evt.item.id] = evt.result; }
}

function handleComplete(evt) {
	var queue = evt.target;
	ss["idea2_atlas_"] = queue.getResult("idea2_atlas_");
	exportRoot = new lib.idea2();

	stage = new createjs.Stage(canvas);
	stage.addChild(exportRoot);
	stage.update();

	createjs.Ticker.setFPS(lib.properties.fps);
	createjs.Ticker.addEventListener("tick", stage);
}

<script type="text/javascript">
        //app.initialize();
		$(document).ready(onDeviceReady);
		document.addEventListener('deviceready', onDeviceReady, false);
		
		
		var direction="";
		var dir_id="";
		// PhoneGap is loaded and it is now safe to make calls PhoneGap methods
		//
		function onDeviceReady() {
			
			 window.plugins.OneSignal.getIds(function(ids) { 
				//console.log('getIds: ' + JSON.stringify(ids)); 
				//alert("userId = " + ids.userId + ", pushToken = " + ids.pushToken);
				localStorage.hd_device_token = ids.pushToken;
			  });
			  var notificationOpenedCallback = function(jsonData) {
				//alert('notificationOpenedCallback: ' + JSON.stringify(jsonData));
				var notif_data = eval(jsonData)
				var this_notif_data = notif_data.notification.payload;
				//alert(notif_data);
				if(this_notif_data.additionalData.url){
					direction = this_notif_data.additionalData.url;
					dir_id = this_notif_data.additionalData.id;
				}
			  };
			
			  window.plugins.OneSignal
				.startInit("14024293-9df2-4fbf-9c61-6c6edfabb7cf")
				.handleNotificationOpened(notificationOpenedCallback)
				.endInit();
			
			
			
			setTimeout(function(){	
				//alert(this_fbase_key)
				goindex()
			},2000);
			
		}
		
		
		function goindex(){
			setTimeout(function(){
				alert("No internet connection. Please restart application.");
				navigator.app.exitApp();
			},30000);
			
			if(localStorage.hd_start==undefined || localStorage.hd_start==""){
				setTimeout("window.location.href='intro.html'",100);
				//localStorage.hd_device_token = device.uuid;
				//alert(device.uuid)
			}else{
				if(direction!=""){
					setTimeout("window.location.href='"+ direction +".html?id="+ dir_id +"'",100);
				}else{
					
					get_ready()
				}
			}
			
			function get_ready(){
				//localStorage.hd_device_token = device.uuid;
				setTimeout("window.location.href='index.html'",3000);
				//alert(device.uuid)
					
			}
			//console.log("device ready")			
		}
